import React from 'react';
import Message from '../Message/Message';
import './Messages.css';


const Messages = ({messages, name}) =>(
    <div>
        {messages.map((message, i) => <div className="" key={i}><Message message={message} name={name}/></div>)}
    </div>
)

export default Messages;
